import React from "react";
import {
  Box,
  Divider,
  IconButton,
  Typography,
  useTheme,
} from "@mui/material";
import FlexBetween from "components/FlexBetween";
import WidgetWrapper from "components/WidgetWrapper";
import { useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { setPost } from "state";

const CourseWidget = ({
  courseId,
  title,
  credits,
  termCode,
  subjectCode,
  courseID,
  courseDesignation,
  subscribed,
}) => {
  const dispatch = useDispatch();
  const token = useSelector((state) => state.token);
  const loggedInUserId = useSelector((state) => state.user._id);

  const { palette } = useTheme();
  const main = palette.neutral.main;
  const primary = palette.primary.main;

  // Add your desired component logic here

  return (
    <WidgetWrapper>
      <Box p="1rem" width="100%">
        <Typography variant="h6" sx={{ color: primary, marginBottom: "0.5rem" }}>
          {title}
        </Typography>
        <Typography variant="body1">{`Credits: ${credits}`}</Typography>
        <Typography variant="body1">{`Course Designation: ${courseDesignation}`}</Typography>
        <Typography variant="body1">{`Subscribed: ${subscribed}`}</Typography>
      </Box>

      {/* Add additional UI elements and functionality as needed */}
    </WidgetWrapper>
  );
};

export default CourseWidget;
